import React, { Component } from 'react';


class Like extends Component {
    render() { 
        return ( <div>
            <span>
                <i class={this.getClass()} aria-hidden="true"></i>
                </span>
            </div>
            );
    }
}

const getClass = () => {
    let classLike = 'fa';
    if (this.props.liked === true)
    return classLike += 'fa-heart'

    return classLike += 'fa-heart-o'
}

export default Like;
